        d = []
        for i in range(2, int(sqrt(n)) + 1):
            if n % i == 0:
                d.append(i)
                if i * i != n:
                    d.append(n * i)
        d.append(n)
        return d

    def sort(d):
        order = []
        order.append(d[0])
        count = len(d)
        d.remove(d[0])
        j = 0
        while len(order) < count:
            if int(gcd(d[j], order[-1])) != 1:
                order.append(d[j])
                d.remove(d[j])
                j = 0
            else:
                j += 1
        return order
    d = divisors(n)
    moves = 0
    if len(d) == 1:
        return (d, 0)
    order = sort(d)
    if gcd(order[0], order[len(order) - 1]) == 1:
        moves += 1
    return (order, moves)

